// Signup.js
import React from "react";

function Signup() {
  const backgroundStyle = {
    backgroundImage: 'url("../images/bgsignup.jpg")', // Assuming the image is in the public/images folder
    backgroundSize: "cover",
    backgroundPosition: "center",
    backgroundRepeat: "no-repeat",
    height: "100vh", // Set a height so the background is visible
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
    color: "white", // Set text color to white or a contrasting color
  };

  return (
    <div style={backgroundStyle}>
      <h1>Hi</h1>
    </div>
  );
}

export default Signup;
